import React from "react";
import "../Components/Main.css";

const Main = () => {
  return (
    <>
      <div className="continer-fluit">
        <div className="p-5 mb-4 bg-light rounded-3">
          <div className="container-fluid py-3">
            <span className="display-6">Yoga For Flat Abs</span>
          </div>
          <div className="container-fluid py-1 days">
            <span className="display-8">90 Days Program</span>
          </div>
          <div className="row mb-4 py-4">
            <div className="col-md-6">
              <div className="row g-2 mb-4 shadow-sm h-md-250 position-relative video_box">
                <div className="col p-5 d-flex flex-column position-static">
                  <strong className="d-inline-block mb-5">
                    introduction Video
                  </strong>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Main;
